import React from 'react';



export function About() {

  return (
      <div className='container'>
        <div className='col'>
            <h3 style={{fontSize: '15px'}}>About cosmosapiens</h3>
        </div>
        <div className='col'>
            <p style={{fontSize: '15px'}}>Ever wanted to take part in space colonization? Well you're about to cop your one-way ticket to the sickest clubhouse on the block...chain. 
            <br />Cosmosapiens are the result of human-computer cooperation, each is unique and programmatically generated from over 170 possible traits, including expression, headwear, clothing, and more. 
            <br />All apes are dope, but some are rarer than others. The apes are stored as ERC-721 tokens on the Ethereum blockchain and hosted on IPFS. (See Record and Proof.) Purchasing an ape costs 0.08 ETH.
            <br />To access members-only areas such as THE BATHROOM, Apeholders will need to be signed into their Metamask Wallet.</p>
        </div>
        
      </div>
      
      
  );
}
